        payable: false,
        type: "function",
    },
    {
        name: "exchangeTemplate",
        outputs: [{ type: "address", name: "out" }],
        inputs: [],
        constant: true,
        payable: false,
        type: "function",
    },
    {
        name: "tokenCount",
